function CardView(props) {
  const card = props.cards.filter((item) => item.id === 2);

  const pp = card.volume.map((volume, index) => ({
    id: index + 1,
    title: `${volume}`,
    content: `${card.Rupee[index]}`,
    content2: `${card.Save[index]}`,
  }));

  console.log(pp);

  // for (let i = 0; i < count; i++) {
  //   data.push({
  //     id: i + 1,
  //     volume: data1.volume[i],
  //     Rupee: data1.Rupee[i],
  //   });
  // }
  const data = [];

  //const data = extractData(card);

  // const data = [
  //   { id: 1, volume: 10, Rupee: 5 },
  //   { id: 2, volume: 20, Rupee: 6 },
  //   { id: 3, volume: 30, Rupee: 7 },
  // ];

  return (
    <div className="card-view">
      {data.map((card) => (
        <Card key={card.id} title1={card.volume} title2={card.Rupee} />
      ))}
    </div>
  );
}

export default CardView;
